import React from "react";

export default function Subcategories() {
  const handleClick = () => {
    const mainCategories = document.querySelector(".subcategories");
    mainCategories.style.zIndex = "0";
  };

  return (
    <div className="subcategories">
      <i class="fa-solid fa-angle-left" onClick={handleClick}></i>
      <h2>Choose Category</h2>
      <div className="subcategory-name">
        <p>Food</p>
      </div>
      <h2>Subcategories</h2>
    </div>
  );
}
